import React from 'react';
import Button from './Button';

const buttonListItems = ['All', 'Songs', 'Gaming', 'Cricket', 'Soccer', 'News'];

const ButtonList = () => {
	return (
		<div className="flex">
			{buttonListItems.map((item) => (
				<Button name={item} />
			))}
		</div>
	);
};

export default ButtonList;
